   // Ajouter le GeoJSON à la carte avec un style personnalisé
   L.geoJSON(med, {
       style: function(feature) {
           return {
               color: "blue",         // Couleur des bordures des polygones
               weight: 2,             // Épaisseur des bordures
               fillColor: "green",    // Couleur de remplissage des polygones
               fillOpacity: 0.5       // Opacité du remplissage
           };
       },
       onEachFeature: function (feature, layer) {
           // Ajouter une popup avec l'ID des polygones
           layer.bindPopup("ID du polygone : " + feature.properties.id);
       }
   }).addTo(map);